import React from "react";
import "./styles/l";

const LanguageTable = ({ data }) => {
  return (
    <div className="table-container">
      <h2>언어 세부 정보</h2>
      <table>
        <thead>
          <tr>
            <th>순위</th>
            <th>언어</th>
            <th>GitHub</th>
            <th>Stack Overflow</th>
            <th>Google</th>
            <th>점수</th>
          </tr>
        </thead>
        <tbody>
          {data.map((lang, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>{lang.language}</td>
              <td>{lang.github}</td>
              <td>{lang.stackoverflow}</td>
              <td>{lang.google_trend}</td>
              <td>{lang.trend_score}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default LanguageTable;
